ingredients_text:
Wheat Flour (with Calcium, Iron, Niacin (B3) , Thiamin (B1)], Water, Seed Mix (16%) (Sesame Seed, Brown Linseed, Sunflower Seed, Millet Seed, Poppy Seed), Yeast, Sugar, Malted Barley Flour, Vegetable Oils (Rapeseed and Sustainable Palm), Salt, Wheat Gluten, Soya Flour, Emulsifiers: E471, E472e; 
Preservative: Calcium Propionate; 
Flour Treatment Agent: Ascorbic Acid (Vitamin C).
